import axios from "axios";


const GetQuote = () => {
    const getPosts = async () => {
        try {
            const userPosts = await axios.get("https://jsonplaceholder.typicode.com/posts")

            console.log(userPosts.data);

        } catch (err) {
            console.error(err.message);
        }
    };
    useEffect(() => {

        getPosts()
    })

}
export default GetQuote;
